import streamlit as st
import pickle
import numpy as np

# st.set_page_config(layout="wide")


background_css = """
<style>
/* CSS for setting background image */
.stApp {
    background-image: url('data:image/jpeg;base64,');
    background-size: cover;
    background-repeat: no-repeat;
}

.row-widget p {
    color: black;
    font-weight: bold;
    font-size: 18px;
    background-color: white;
    border-radius: 5px;
    padding: 1px 8px;
}
</style>
"""

# Inject CSS into Streamlit app
st.markdown(background_css, unsafe_allow_html=True)


# Load the pre-trained model
@st.cache_resource
def load_model():
    with open("./assets/model.pkl", "rb") as f:
        model = pickle.load(f)
    return model


model = load_model()


def main():
    # Get user input
    dependents = st.text_input(
        "Number of Dependents of the Applicant (number):", "2", key="dependents"
    )
    income = st.text_input(
        "Annual Income of the Applicant (number):", "3500000", key="income"
    )
    amount = st.text_input("Loan Amount (number):", "8100000", key="amount")
    term = st.text_input("Loan Term in Years (number): ", "4", key="term")
    credit_score = st.text_input("Credit Score (number)", "589", key="credit_score")
    residential_assets = st.text_input(
        "Residential Assets Value (number)", "3800000", key="residential_assets"
    )
    commercial_assets = st.text_input(
        "Commercial Assets Value (number)", "6700000", key="commercial_assets"
    )
    luxury_assets = st.text_input(
        "Luxury Assets Value (number)", "12500000", key="luxury_assets"
    )
    bank_asset = st.text_input("Bank Asset Value (number)", "2700000", key="bank_asset")

    education = st.selectbox("Education", ("True", "False"), index=0, key="education")

    self_employed = st.selectbox(
        "Self Employed", ("True", "False"), index=0, key="self_employed"
    )

    # Make predictions
    if st.button("Predict"):

        my_list = [
            dependents,
            income,
            amount,
            term,
            credit_score,
            residential_assets,
            commercial_assets,
            luxury_assets,
            bank_asset,
        ]

        fi_condition = [float(x) for x in my_list if isinstance(x, str)]
        fi_condition.append(bool(education))
        fi_condition.append(bool(self_employed))

        fi_condition = np.array(fi_condition).reshape(1, -1)

        prediction = model.predict_proba(fi_condition)

        st.markdown(
            "<h2 style='color: black;'>Based on previous case experiences, the probability of loan approval in this case is</h2>",
            unsafe_allow_html=True,
        )

        st.markdown(
            f"<h2 style='color: black;'>{round(prediction[0][1]*100 , 2)}%</h2>",
            unsafe_allow_html=True,
        )

        # st.header(f"{round(prediction[0][1]*100 , 2)}%")


if __name__ == "__main__":
    # st.title("")

    st.markdown(
        "<h1 style='color: black;'>Ling Loan Solution</h1>", unsafe_allow_html=True
    )

    st.markdown(
        "<h2 style='color: black;'>The <span style='color: #00679B'>BEST SOLUTION</span> to evaluate the loan approvement based on your client financial condition</h2>",
        unsafe_allow_html=True,
    )

    main()
